#
# Write a function rotate(arr[], d, n) that rotates array arr[] of size n by d elements
#
# https://leetcode.com/problems/rotate-array/solution/
# https://www.geeksforgeeks.org/array-rotation/


def rotate(arr, n, k):
    """ Method 1: Shift first d elements to the end. Shift last n-d elemnts to Left.
        Time Complexity: O(n), Space Complexity: O(n)
    """
    # Calculate Min Number of Rotations Required
    k = k % n

    # Copy First K Elements
    tmp_arr = arr[0:k]

    # Shift last n-k elements to left
    arr = arr[k:]

    # Append first K elements at the end
    for x in tmp_arr:
        arr.append(x)

    return arr


def rotate2(arr, n, d):
    """ Method 2: Rotate the array 1 element at a time, d times
        Time Complexity: O(n*d) , Space Complexity: O(1)
    """

    # Method to Left Shift all elements in array, by 1
    def left_shift(arr, n):
        tmp = arr[0]
        for i in range(n-1):
            arr[i] = arr[i+1]
        arr[-1] = tmp
        return arr

    # Calculate Min Number of Rotations Required
    d = d % n

    # Shift 1 element at a time
    for i in range(d):
        arr = left_shift(arr, len(arr))

    return arr


def rotate3(arr, n, d):
    """ Method 3: Reverse Array. Reverse First d elements. Reverse last n-d elements
        Tie Complexity: O(n), Space Complexity: O(1)
    """

    d = d % n

    arr = reverse(arr, 0, n-1)

    arr = reverse(arr, 0, d-1)

    arr = reverse(arr, d, n-1)

    return arr


def reverse(arr, start, end):
    while start < end:
        arr[start], arr[end] = arr[end], arr[start]
        start += 1
        end -= 1
    return arr


